	add("custom", "{\"term\":\"custom\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Middle english (1100-1500) {{m|enm|custume}}, from Anglo-norman {{m|fro|custume}}, from Old french (842-ca. 1400) {{m|fro|coustume}}, from *{{m|la|cōnsuētūmen}}, from Latin {{m|la|cōnsuētūdinem}}, accusative singular of {{m|la|cōnsuētūdō||custom, habit}}, from {{m|la|cōnsuēscō||accustom, habituate}}, from {{m|la|con-||with}} + {{m|la|suēscō||become used or accustomed}}, inchoative form of {{m|la|sueō||I am accustomed}}, perhaps from {{m|la|suus||one\u0027s own, his own}}; see {{m|la|consuetude}}. Displaced native Middle english (1100-1500) {{m|enm|wune|wune, wone|custom, habit, practice}} (from Old english (ca. 450-1100) {{m|ang|wuna||custom, habit, practice, rite}}), Middle english (1100-1500) {{m|enm|side|side, sid|custom}} (from Old english (ca. 450-1100) {{m|ang|sidu|sidu, sido|custom, note, manner}}), Middle english (1100-1500) {{m|enm|cure||custom, choice, preference}} (from Old english (ca. 450-1100) {{m|ang|cyre||choice, choosing, free will}}).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Frequent repetition of the same behavior; way of behavior common to many; ordinary manner; habitual practice; usage; method of doing, living or behaving\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"And teach \u0027\u0027customs\u0027\u0027 which are not lawful. \u0027Acts xvi. 21\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Moved beyond his \u0027\u0027custom\u0027\u0027, Gama said. \u0027w:Alfred Alfred Tennyson\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A \u0027\u0027custom\u0027\u0027 More honored in the breach than the observance. \u0027Shakespeare\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Habitual buying of goods; practice of frequenting, as a shop, manufactory, etc., for making purchases or giving orders; business support\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Let him have your \u0027\u0027custom\u0027\u0027, but not your votes. - \u0027w:Joseph Joseph Addison\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Long-established practice, considered as unwritten law, and resting for authority on long consent; usage. See Usage, and Prescription\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Usage is a fact. \u0027\u0027Custom\u0027\u0027 is a law. There can be no \u0027\u0027custom\u0027\u0027 without usage, though there may be usage without \u0027\u0027custom\u0027\u0027. \u0027Wharton\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Familiar acquaintance; familiarity\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Age can not wither her, nor \u0027\u0027custom\u0027\u0027 stale Her infinite variety. \u0027Shakespeare\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The customary toll, tax, or tribute\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Render, therefore, to all their dues: tribute to whom tribute is due; \u0027\u0027custom\u0027\u0027 to whom \u0027\u0027custom\u0027\u0027. \u0027Rom. xiii. 7\", \"priority\":12}]}, \"synonyms\":{}}");

